import './App.css';
import Navbar from './components/Navbar';
import WeatherApp from './WeatherApp';

function App() {

  return (
    <div className="App bg-default h-screen">
      <header className="App-header sticky top-0 p-4 flex justify-between max-w-7xl mx-auto z-99 xl:items-center">
        <Navbar />
      </header>

      <div className='m-1 p-2'>
        <WeatherApp />
      </div>
    </div>
  );
}

export default App;
